#include <string>
#include <cassert>
#include <iostream>
#include <vector>
#include <set>

using namespace std;

class Solution {
public:
    bool is_there_same_character(string s) {
        for (int i=0; i<s.size(); i++) {
            // choose one
            char c = s[i];

            // check
            for (int j=i+1; j<s.size(); j++) {
                if (c == s[j]) {
                    return true;
                }
            }
        }
        return false;
    }

    set<string> get_not_repeat_character_substrings_by_size(string s, unsigned int size) {
        set<string> substrings;

        for (int i=0; i<s.size()-size+1; i++) {
            string substring = s.substr(i, size);

            if (is_there_same_character(substring)) {
//                cout << "there is same:" << substring << endl;
                continue;
            }

//            cout << "there isn't same:'" << substring << "'" << endl;
            substrings.insert(substring);
        }

        return substrings;
    }

    int lengthOfLongestSubstring(string s) {
        if (s.size() == 0) {
            return 0;
        }
        // get substrings from longest
        for (unsigned long i=s.size(); i>1; i--) {
            set<string> substrings = get_not_repeat_character_substrings_by_size(s, i);
            if (substrings.size() != 0) {
                return (int)i;
            }
        }

        return 1;
    }
};

